import "../style.css";

let componentDidMount = () => {
    // Simple GET request using axios
    axios
      .get("https://movie-task.vercel.app/api/popular?page=1")
      .then(
        (datas) => console.log(datas.data.data.results[1]));
  };








export function Header() {
  return (
    <>
      <div className="header">HELLO</div>
    </>
  );
}
